  constructor(props) {
    super(props);
    this.state = {
    }
  }

  render () {
    return (
      <div>
        <HeadTitle firstPartFont='../assets/shou.png' thirdPartFont='游记讯息'></HeadTitle>
        <HeadTitle firstPartFont='../assets/guan.png' thirdPartFont='博物馆志'></HeadTitle>
        <HeadTitle firstPartFont='../assets/gui.png' thirdPartFont='行程规划'></HeadTitle>
      </div>
    )
  }
}

export default App;
